import { configureStore } from '@reduxjs/toolkit';
import { pokemonSlice } from '../features/counter/counterSlice';
import { pokemonApi } from './api-pokemon.tsx'

export const store = configureStore({
  reducer: {
    pokemonListing: pokemonSlice.reducer,
    [pokemonApi.reducerPath]: pokemonApi.reducer
  },
});
